%[text] %[text:anchor:T_B3E259E8] # Medical Volume Visualization 
%[text] ## Medical Volume File Formats
%[text] In this course, we will manage several different types of medical volume formats, including
%[text] - NRRD - 3D slicer default format
%[text] - DICOM - a standard widely adopted by hospitals and medical software industry
%[text] - NIFTI - used primarily for MRI datasets \
%[text] In this Script, we will focus on Volume Rendering.
%[text] 
%[text] 
%[text] ## Volume Rendering
%[text] Volume Rendering visualizes internal structures in image volumes as 3D objects — without segmentation. Specifically, when volume rendering, you set the opacity of each voxel, making some voxels opaque and some transparent. The opacity values for each voxel are stored in what is called an "alphamap". In an alpha map, every voxel intensity is mapped to a opacity setting. The most common mapping is to set Intensities of Zero (typically black in a 2D image) to completely transparent (an alpha of zero). So, if you have an image volume where there was nothing imaged on the outer edges (intensities of zero), those edges become transparent and you can now "see" inside the volume to where there are intensities above zero—where things were imaged. 
%[text] ### Learning Objectives
%[text] - Explain how Volume Rendering displays internal structures in an image volume
%[text] - Understand how alphamaps affect voxel transparency in an image volume
%[text] - Explain DICOM and how it is used to store medical volumes.
%[text] - Use the functions **dicomBrowser** and **dicominfo** to inspect dicom volumes
%[text] - Use the functions **volumeViewer** and **volShow** to render image volumes \
%[text:tableOfContents]{"heading":"Table of Contents"}
%[text] ## Example Volume: Lung CT
%[text] For this example, we load a Lung CT volume found in the MedicalVolumeDICOMData folder in the Unit Data folder. 
clearvars
close all

mmSetUnitDataFolder(3); % change Current Folder to the Unit 3 Data Folder
mvFolder = "MedicalVolumeDICOMData";
%[text] - Explore the "MedicalVolumeDICOMData" folder
%[text] - It has three folders: LungCT01, 02, and 03
%[text] - Each folder contains a series of images that comprise the DICOM dataset \
%%
%[text] ### Inspect the DICOM dataset
%[text] A DICOM dataset is a standard dataset generated by most medical imaging devices, like a CT Scanner or an MRI machine. I have saved a sample DICOM dataset in the unit3 folder. Let's inspect that dataset now
ls(mvFolder)
%[text] - (The function `ls` returns the contents of a folder)
%[text] - There are actually 3 separate folders in the MedicalVolumeDICOMData folder
%[text] - Each folder represents a different CT Scan (aka Series) \
%%
%[text] In each folder, there are a series of files
ls(fullfile(mvFolder,"LungCT01"))
%[text] - In this case, the files have .DCM extension
%[text] - This is not always the case — Sometimes the files don't have any extension.
%[text] - But each file represents one slice in the CT dataset \
%%
%[text] ### Inspect Metadata
%[text] The metadata is stored with each dicom image in the series. Here we load the metadata for the "CT000000.dcm" image.
meta = dicominfo(fullfile(mvFolder,"LungCT02","CT000000.dcm"))
%[text] - There's a lot of metadata in there, many of it hard to decipher
%[text] - This dataset was Anonymized (patient ID removed \
%[text] Look for the following data fields
%[text] - Width and Height
%[text] - BitDepth
%[text] - Modality
%[text] - Manufacturer and Model Number
%[text] - DeidentificationMethod
%[text] - SliceThickness
%[text] - XRayTubeCurrent \
%%
%[text] ### Explore Images in the Data series
%[text] We can explore the DICOM dataset using the **dicomBrowser**
dicomBrowser(mvFolder)
%[text] - Notice that the top folder ("MedicalVolumeDICOMData") organizes the three datasets, called Series, as described in the SeriesDescription
%[text] - Click on one of the Series
%[text] - You can see see the individual images of the Series \
%%
%[text] ### Export Volume into Workspace
%[text] - Select Series 2 in the dicomBrowser
%[text] - Select "Export Series to workspace"
%[text] - Inspect Volume in workspace \
size(V)
range(V(:))
%%
figure;
histogram(V)
%%
ylim([0 1.5e6])
%%
%[text] ## Volume Viewer
%[text] - You can export each volume into the **volumeViewer** app directly from the **dicomBrowser** (using the Export Menu)
%[text] -     Note: this does not work online
%[text] - In volumeViewer, you can see a volume render in the 3D window
%[text] - Notice that this volume is cylindrical (kind of like the shape of the bore in a CT machine) \
%%
%[text] ### Adjust Volume Rendering
%[text] - There are many presets for the rendering — Try them all
%[text] - These presets control what is called an Alpha Map.
%[text] - An alpha map is a transparency map for each voxel - Each voxel intensity is mapped to a particular transparency
%[text] - Air is usually -1000, so you usually want low values to transparent \
%[text] ### Manually Adjust Alpha Map
%[text] The following setting makes the the lungs more opaque and the surrounding tissue more transparent
%[text] - Start with lungs and go from there \
%[text] ![](text:image:8f58)![](text:image:80f3)
%[text] - You can find the ribs by starting with ct-bone and adjusting from there \
%[text] ![](text:image:6b3b)![](text:image:9b8b)
%%
%[text] Export your settings
%[text] ![](text:image:405b)
%[text] - review the objectConfig
%[text] - The AlphaMap contains the transparency mapping \
%%
figure;
bar(objectConfig.Alphamap)
xlabel("Intensity")
ylabel("Opacity")
%%
%[text] ## Medical Volume Toolbox
%[text] The medical volume toolbox includes functions to make working with medical datasets a easier. 
%[text] [Approaches for medical visualization](https://www.mathworks.com/help/releases/R2025b/medical-imaging/ug/choose-approach-for-medical-image-visualization.html)
%%
%[text] ### Medical Labeler
%[text] This app is a souped-up version of volumeViewer
medicalImageLabeler
%[text] #### Load volume
%[text] 1. Create New Session
%[text] 2. Use the default location: Save to MATLAB folder
%[text] 3. Notice the volume looks a little different from volShow display (window and level automatically set)
%[text] 4. Display Markers: Scale bars, 3D orientation
%[text] 5. View Shortcuts
%[text] 6. Try: Shift-left-click-drag \
%[text] #### Navigating
%[text] 1. Scrubbing zooms
%[text] 2. Dragging on sliders scrubs through images
%[text] 3. Crosshair Navigation - aligns all slice views \
%[text] #### Volume Rendering
%[text] 1. The Volume rendering presets work a little better (try them now).
%[text] 2. Compare the rendering editor techniques: Volume Rending, MIP, Gradient Opacity
%[text] 3. Save a volume rendering - appears in the menu \
%[text] 
%[text] 
%%
%[text] ### Loading Medical Volumes into the workspace
%[text] The function **medicalVolume** simplifies loading volumes into the workspace
%[text] %[text:anchor:TMP_8032] Load CT Volume into workspace
%[text] Here we use the **medicalVolume** function to load the LungCT01 DICOM dataset.
mV = medicalVolume(fullfile(mvFolder,"LungCT01")) % Load a CT Volume
%[text] The **medicalVolume** function returns a medicalVolume object (kind of like a structure). Review the properties of this medicalVolume object. Most properties should be fairly straightforward to understand. For example: 
%[text] - **Voxels** contains the volume
%[text] - **VoxelSpacing** are the dimensions of the voxels in millimeters
%[text] - **VolumeGeometry** contains information to transform the volume to match real-world dimensions  \
%%
%[text] Review the voxel data
figure;
histogram(mV.Voxels(:))
%%
%[text] Rescale to Hounsfield units
hVol = squeeze(single(mV.Voxels)) * meta.RescaleSlope - meta.RescaleIntercept;
figure;
histogram(hVol)
%%
%[text] ## Review the Slices
%[text] When first loading an image volume, it is often useful to scrub through the image slices to get a sense of what the image data looks like. When we load a medicalVolume, we can use the sliceViewer to review the slices
figure(Visible="on")
sliceViewer(mV)
%[text] Here we have CT slices through the Chest of a Patient
%[text] - Turn on the Data Tip tool, click on the image, and then drag the tool tip around the image
%[text] - Notice that air is a negative number
%[text] - Notice that bone is a positive number (~200) \
%%
%[text] ### Visualizing the volume in volumeViewer
%[text] To display a medicalVolume in the volumeViewer app, you input the "Voxels" field:
volumeViewer(mV.Voxels)
%[text] - volume doesn't look right because you are inputting just the voxels without the any of the sizing information \
%%
%[text] #### Fix display in Volume Viewer
%[text] - There are four panels in the default display for volumeViewer: 3 orthogonal planes and a Volume Render of the volume
%[text] - In the 3D Volume panel, the volume appears to be a little flat (also in the XZ slice)
%[text] - This is because the voxels are anisotropic (`[0.72852 0.72852 2.5]) but volumeViewer is assuming that they are isotropic ([1 1 1])`
%[text] - `To fix the display, enter the voxel dimensions in 3D Display tab` \
%[text] ![](text:image:1820)
%[text] - Now the volume displays normally
%[text] - We are just changing the display. We haven't changed the volume itself. \
%[text] 
%%
%[text] ### Display volume using volshow
%[text] The function `volshow` can display the volume right in the livescript.
% display the volume
hvs = volshow(mV);
%[text] - add crop box
%[text] - add slice plane
%[text] -     - drag on plane to move location along axis
%[text] -     - drag on pin to change the axis
%[text] -     - right click to return to standard axis \
%%
%[text] ### Customize volshow display
%[text] - you can roll your own alphamap \
% custom alpha settings for LungCT01
alpha = [0 0 0.72 1.0]; % alpha seeds for interpolation
color = [0 0 0; 186 65 77; 231 208 141; 255 255 255] ./ 255; % color seeds for interpolation
intensity = [-3024 100 400 1499];
queryPoints = linspace(min(intensity),max(intensity),256);
alphamap = interp1(intensity,alpha,queryPoints)';
colormap = interp1(intensity,color,queryPoints);

% display the volume
hvs = volshow(mV,Colormap=colormap,Alphamap=alphamap,RenderingStyle="CinematicRendering");
%%
%[text] #### Useful for visualizing multiple volumes
mV = medicalVolume(fullfile(mvFolder,"LungCT02")); % Load a CT Volume
hvs = volshow(mV,Colormap=colormap,Alphamap=alphamap,RenderingStyle="CinematicRendering");
%%
%[text] Use rendering settings from VolShow
hvs = volshow(mV,Colormap=objectConfig.Colormap,Alphamap=objectConfig.Alphamap)

